export default function App() {
  return (
    <>
      <Router>
        <Routes>
          <Route exact path='/' element={<Home/>} />
          <Route path='/battler' element={<Battle/>} />
          <Route path='/about' element={<About/>} />
          <Route path='/home' element={<Home/>} />
        </Routes>
      </Router>
    </>
  );
}
